import { Route, Routes } from "react-router-dom";
import MainPage from "./MainPage";

const Main = () => {
  return (
    <Routes>
      <Route exact path="/" element={<MainPage />}></Route>
      <Router exact path="/rooms"></Router>
    </Routes>
  );
};

export default Main;
